function simplepag_(items_, itemsOnPage_, divPag, divContent, urlLoad) {
    this.urlLoadInit = urlLoad;

    function charParam(url) {
        var ch2_ = '?';
        if (url.indexOf('?') != -1) {
            ch2_ = '&';
        } else {
            ch2_ = '?';
        }
        return ch2_;
    }

    function initP_() {
        $(function () {
            $("#" + divPag).pagination({
                items: items_,
                itemsOnPage: itemsOnPage_,
                cssStyle: 'light-theme',
                onPageClick: function (pageNumber, event) {
                    loadContent_(pageNumber);
                }
            });
        });
    }
    initP_();

    function loadContent_(pag) {
        $("#" + divContent).html("<div align='center'><img src='data:image/gif;base64,' alt='Cargando...'/><br/><i style='color:gray'>Cargando Contenido (Pag. " + pag + ") ...</i></div>");
        $.get(urlLoad + charParam(urlLoad) + 'pag_=' + (pag - 1), function (data) {
            $(" #" + divContent).html(data);
        });
    }
    loadContent_(1);

    var ascDesc = "DESC";

    this.orderBy_ = function (attrOrd) {
        urlLoad = this.urlLoadInit + charParam(this.urlLoadInit) + "cOrder_=" + attrOrd + "&ascDesc_=" + ascDesc;
        initP_();
        loadContent_(1);

        if (ascDesc == 'ASC') {
            ascDesc = 'DESC';
        } else {
            ascDesc = 'ASC';
        }
    }

}
